import logo from './logo.svg';
import './App.css';

import React, { Component } from 'react';
import Navbar from './Navbar';
import News from './News';
import { BrowserRouter, Routes, Route } from 'react-router';

export default class App extends Component {
  render() {
    return (
      <div>
        <BrowserRouter>
          <Navbar />
          <Routes>
            <Route exact path="/"><News  pagesize={5} country="us" category="general" /></Route>
            <Route exact path="/business"><News key="business" pagesize={5} country = "us" category = "business"/></Route>
            <Route exact path="/entertainment"><News key="general" pagesize={5} country = "us" category = "entertainment"/></Route>
            <Route exact path="/general"><News key="general" pagesize={5} country = "us" category = "general"/></Route>
            <Route exact path="/health"><News key="general" pagesize={5} country = "us" category = "health"/></Route>
            <Route exact path="/science"><News key="general" pagesize={5} country = "us" category = "science"/></Route>
            <Route exact path="/sports"><News key="general" pagesize={5} country = "us" category = "general"/></Route>
            <Route exact path="/technology"><News key="general" pagesize={5} country = "us" category = "technology"/></Route>

          </Routes>
        </BrowserRouter>
      </div>
    );
  }
}
